import React from "react";
import { useSlider } from "react-range";
import * as ReactRange from "react-range";

const CollapsibleSlider = ({ min, max, step, values, onChange }) => {
  const { getTrackProps, getHandleProps } = ReactRange.useSlider({
    min,
    max,
    step,
    values,
    onChange,
  });

  return (
    <div>
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          margin: "10px",
        }}
      >
        <div
          style={{
            height: "5px",
            width: "100%",
            background: "#ccc",
            position: "relative",
          }}
          {...getTrackProps()}
        >
          {values.map((value, index) => (
            <div
              key={index}
              style={{
                position: "absolute",
                top: "-5px",
                left: `${(value / max) * 100}%`,
                transform: "translate(-50%, 0)",
                width: "10px",
                height: "10px",
                background: "#fff",
                border: "2px solid #ccc",
                borderRadius: "50%",
                cursor: "pointer",
              }}
              {...getHandleProps(index)}
            />
          ))}
        </div>
      </div>
    </div>
  );
};

export default CollapsibleSlider;
